import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <section id="home" className="home">
      <div className="hero">
        <h1>Welcome to WR Resto</h1>
        <p>Delicious meals, made fresh for you!</p>
        <a href="#menu" className="btn">
          View Menu
        </a>
      </div>
    </section>
  );
};

export default Home;
